import React from "react";
import { Fragment } from "react";
import HomePageHeader from "./components/LandingPage/HomePageHeader";
import IntroSection from "./components/LandingPage/IntroSection";
import HomeSection1 from "./components/LandingPage/HomeSection1";
import HomeSection2 from "./components/LandingPage/HomeSection2";

const HomePage = (props) => {
  return (
    <Fragment>
      <HomePageHeader> </HomePageHeader>
      <IntroSection></IntroSection>
      <HomeSection1></HomeSection1>
      <HomeSection2></HomeSection2>
    </Fragment>
  );
};
